import React from 'react';
import Modal from 'react-modal';
const Footer = () => {
	const [modalIsOpen, setIsOpen] = React.useState(false);

	function openModal() {
		setIsOpen(true);
	}

	function closeModal() {
		setIsOpen(false);
	}
	return (
		<div className="w-full bg-secondary border-t-2">
			<Modal
				isOpen={modalIsOpen}

				onRequestClose={closeModal}
				className={"absolute"}
				contentLabel="Example Modal"
			></Modal>
			<div className="container flex flex-col py-10 lg:flex-row  justify-between items-center md:max-w-[1480px] m-auto max-w-[600px] text-white text-sm">
				<span>Cars Spot</span>
				<button className="underline" onClick={openModal}>
					Polityka prywatnosci
				</button>
			</div>
		</div>
	);
};

export default Footer;
